description:
Abbie Cat is a regular in the bar where Renato works as a waiter, and he insists that he should be the one serving the girl's drink, all the time. His dedication finally earns its reward when Abbie, being horny and lonely, decides to give the handsome waiter a treat for her enthusiasm, and get her own fun in the process.

